function draw_emoji_similarity() {
    html = ""
    for (var emoji in DATA) {
        html += "<div>"
        html += "<span class='main'>" + emoji + "</span>"
        seen = new Set()
        for (i in DATA[emoji]) {
            e2 = Object.keys(DATA[emoji][i])
            if (seen.has(e2)) continue
            seen.add(e2)
            html +=  "<span>" + e2 + "</span>"
        }
        html += "</div>"
    }
    $(".emoji-table").html(html)
}
